export enum AppRoutes {
    // Main Page
    MAIN_PAGE = '/',
    // Website Pages
    WEB_HOME = '/website-home',
    // Platform Pages
    PL_HOME = '/platform-home'
}

export const AppRoutesNames = {
    [AppRoutes.MAIN_PAGE]: 'Home',
    [AppRoutes.WEB_HOME]: 'Website',
    [AppRoutes.PL_HOME]: 'Platform'
}
